import React from 'react';
import TestimonialSingle from './testimonialsingle';

function TestimonialsSection() {
    return(
      <section>
    <h1>Testimonials</h1>
      <div>
        <TestimonialSingle rating="5/5" image="Brittany.png" name="Brittany Taylor"
        reviewText="My favorite place to eat with my friends, great food!"/>

        <TestimonialSingle rating="9.5/10" image="Darius.jpg" name="Darius Flynn"
        reviewText="One of the best restaruants to go in Chicago, highly recommended."/>

        <TestimonialSingle rating="4/5" image="Charlie.png" name="Charlie Rosegold"
        reviewText="Fast and speedy service that doesn't skip out on quality."/>

        <TestimonialSingle rating="9/10" image="Jennifer.jpg" name="Charlie Rosegold"
        reviewText="Little Lemon is an absolute gem, can't get enough of it."/>
    </div>
</section>
)}

export default TestimonialsSection;
